import React from "react";

const footerMenuItems = [
  [
    "Shop",
    "Necklaces",
    "Bracelets",
    "Earrings",
    "Piercings",
    "Glasses",
    "Sunglasses",
    "Hair Accessories",
  ],
  [
    "Collections",
    "Fall",
    "Summer",
    "Spring",
    "Winter 2020",
    "Indian Summer",
    "Holiday Spirit",
  ],
  [
    "Account",
    "My Orders",
    "My Favorites",
    "My Account",
    "Customer Service",
    "Terms and Conditions",
    "Privacy Policy",
  ],
];

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer__menu">
        {footerMenuItems.map((item, i) => {
          return (
            <ul key="i" className={`footer__menu--column column-${i + 1}`}>
              {item.map(items => items)}
            </ul>
          );
        })}
      </div>
    </footer>
  );
};

export default Footer;
